import {useState} from "react";
import axios from "axios";
import {useNavigate} from "react-router-dom";

export default function Register(){
 const [u,setU]=useState({username:"",password:"",role:"USER"});
 const nav=useNavigate();
 const reg=async e=>{
  e.preventDefault();
  await axios.post("http://localhost:8080/api/auth/register",u);
  nav("/");
 };
 return(<form onSubmit={reg}>
  <h2>Register</h2>
  <input placeholder="Username" onChange={e=>setU({...u,username:e.target.value})}/>
  <input type="password" placeholder="Password" onChange={e=>setU({...u,password:e.target.value})}/>
  <select onChange={e=>setU({...u,role:e.target.value})}>
   <option>USER</option><option>ADMIN</option>
  </select>
  <button>Register</button>
 </form>);
}
